import React from 'react';
import '../../App.css';


const Contact = () => {
	return (
		<div className="pages">			
			<h1 id="contactHeader">contact</h1>
					<a className="contact"
						href="mailto:pressuresensitive1989@gmail.com">
						email
					</a>
					<a className="contact"
						href="https://pressuresensitive.bandcamp.com/">
						bandcamp
					</a>
					<a className="contact" 
						href="https://www.facebook.com/pressuresensitiveband/">
						facebook
					</a>
  		</div>
	);
}

export default Contact;
